Swipe throughhhh ♥️ 
@lojmasquerade was another successful year ♥️😊 loved being a pirate! So this is the second dragon I’ve gotten to help make for LOJ, the first I’ve gotten to help sculpt though! With just me and @gregaronowitz we made this baby dragon in 10 days, it was hard for me to sculpt faster since I still need that practice 🤣 it’s the biggest thing I’ve gotten to help sculpt! There’s a really special feeling to making something start to finish, I can’t wait to see what we do for future years! Such a fun night of seeing friends and amazing costumes and art! 

#loj #dragon #art #sculpture

