This job turned out so so cute so had to make a post about it! This job was for @mountvernon and @migrationmovie 🦆✨ 
@jolear02 Built the frame that holds the backdrop (in like 4 hours too!!) and helped with setting it up! 
@erikmurillo_fx Helped with the chicken wire and setting up the LEDs that light up inside the clouds ! And stayed into the early morning helping me glue cloud fluff ! 
And I shaped the clouds and applied the fluff ☁️🩷 transportation knocked them around a bit, but luckily brought extra fluff 😂
Thanks for all the help and on to the next thing ☺️! 
